import { List } from "antd";
import React, { Component } from "react";

export default class TodoList extends Component {
  render() {
    return (
      <List
        size="large"
        dataSource={this.props.todoList}
        bordered
        renderItem={(todo) => <List.Item>{todo}</List.Item>}
      />
    );
  }
}
